function Form(){

    const submitHandler = (event) => {
      event.preventDefault();
    }

    return(
      <Form onSubmit = {submitHandler}>
        
          <label htmlFor>Task - No:</label>
          <input type = 'number' name = 'no'></input>
          

        
          <label> Task:</label>
          <input type ='text' name = 'task'></input>
          

        
          <button type = 'submit'> Add </button>  
            
      </Form>
    );

};

export default Form;
